class LNgram{
  static dict = {}

  static contextDict = {"":this.dict,"2":{}}
  static contexts = [{name:""},{name:"2"}]
  static learningContext = "2"

  static generalizations = {}
  static history = []
  static learn(action,ans,n=Infinity){

    this.history.splice(0,0,action)

    if(n>this.history.length){n=this.history.length}


    let generalizestr = this.history[0]
    for(let i = 1 ; i < this.history.length; i++){
      if(this.generalizations[generalizestr] === undefined){break}
      if(this.generalizations[generalizestr] !== true){
        // happening
        console.log("HI, we found a generalized item "+generalizestr)

        this.history.splice(0,generalizestr.split("-").length,this.generalizations[generalizestr])

        break;
      }

      generalizestr = this.history[i] + "-" + generalizestr

    }



    if(ans!==undefined){

      for(let i = 0; i <= n; i++){
        let tarr = this.history.slice(0,i).reverse()
        let str = tarr.join("-")
        // console.log(str)
        if(this.addEntry(str,ans)){break}
      }

    }

  }

  static learnHist(action,n=Infinity){

    this.history.splice(0,0,action)

    if(n>this.history.length){n=this.history.length}

    let needGeneralize = 0

    let generalizestr = this.history[1] + "-" + this.history[0]
    if(this.generalizations[generalizestr] !== undefined){needGeneralize = 1
      console.log("HI, we found a generalized item "+generalizestr)

      this.history.splice(0,generalizestr.split("-").length,this.generalizations[generalizestr])

      break;
        
    }





    if(ans!==undefined){

      for(let i = 0; i <= n; i++){
        let tarr = this.history.slice(0,i).reverse()
        let str = tarr.join("-")
        // console.log(str)
        if(this.addEntry(str,ans)){break}
      }

    }

  }

    static learntFromBack(str){

      let arr = str.split("-")
      let outarr = []
      for(let i = 1; i <= arr.length; i++){
          let tarr = arr.slice(arr.length-i,arr.length-1)
          let tstr = tarr.join("-")
          outarr.push(tstr)
      }

      let lastLetter = arr[arr.length-1]

      outarr.forEach((e)=>{
        if(this.dict[e]==undefined){console.log(e,str);return}
        this.dict[e].score[lastLetter] -= 1
        this.dict[e].count -= 1
      })

      return(outarr)
    }


    static unlearnWith(str){
      let arr = []
      Object.keys(this.dict).forEach((e)=>{
        if(e.includes(str)){arr.push(e)}
      })

      let outarr = []

      arr.forEach((e)=>{
        let s = e.split(str)
        if(s.length === 2){
          if(s[1] === ""){
            outarr = outarr.concat(this.learntFromBack(e),this.learntFromBack(e.split("-").slice(0,-1).join("-")))
          }
          if(s[0] === ""){
            console.log(e.split("-").slice(1).join("-"))
            outarr = outarr.concat(this.learntFromBack(e),this.learntFromBack(e.split("-").slice(1).join("-")))
          }
        }
      })
      return(outarr)
    }

  static curb(n=1){
    n = n+1
    Object.keys(this.dict).forEach((e)=>{
      if(this.dict[e].count < n){
        delete this.dict[e]
      }
    })
  }


  static generalize(str){
    let item = this.dict[str]
    if(this.dict[str]===undefined){console.log("no such entry");return;}




    let combined = str.replaceAll("-","")

    this.generalizations[str] = combined

    let splitstr = str.split("-").reverse()
    let lesser = splitstr[0]
    this.generalizations[lesser] = true

    for(let i = 1; i < splitstr.length-1; i++){
      lesser =  splitstr[i] + "-" + lesser
      this.generalizations[lesser] = true
    }


    // this.unlearnWith(str)


    Object.keys(this.dict).forEach((e)=>{
      if(e.includes(str)){
        this.dict[e.replaceAll(str,combined)] = this.dict[e]
        delete this.dict[e]
      }
    })



  }

  static predict(arr){

    if(typeof(arr)==="string"){
      arr=arr.split("")
    }

    if(arr!==undefined){
      arr.reverse()
    } else {
      arr = this.history
    }



    let AOUT = []

    for(let c = 0; c < this.contexts.length; c++){
      let dict = this.contextDict[this.contexts[c].name]

    let cont = true
    let chain = ""
    let out = []
    let i = 0;
    let item = dict[chain]

      out.push(item)

      chain += arr[i]
      item = dict[chain]
      if(item===undefined){cont=false}
      i++

      while(cont){
        out.push(item)

        chain = arr[i] + "-" + chain
        item = dict[chain]
        if(item===undefined){/*console.log(chain)*/;break;}
        i++
      }
      AOUT.push(out)
    }





    let tout = []
    AOUT.forEach((j)=>{
      j.forEach((e,i)=>{
        if(tout[i] === undefined){tout[i] = e;return}
        tout[i].count += e.count

        Object.keys(e.score).forEach((E)=>{
          if(tout[i].score[E]===undefined){tout[i].score[E] = e.score[E];return}
          tout[i].score[E] += e.score[E]
        })
      })
    })


    return(tout)

  }

  static choose1(prediction,confidence=1){

    confidence = confidence-1
    for(let i = prediction.length-1; i > -1; i--){
      let column = prediction[i]
      let item = getKeyWithHighestValue(column.score)
      if(column.score[item] > confidence){
        return({"prediction":item,"confidence":column.score[item]/column.count})
      }

    }

      // prediction = prediction[prediction.length-1].score
      // prediction = getKeyWithHighestValue(prediction)
      // return({"prediction":prediction,"confidence":column.score[item]/column.count})

  }

  static choose(prediction){

    let arr = []
    let score = 0
    let aitem;
    let j;


    for(let i = prediction.length-1; i > -1; i--){
      let column = prediction[i]
      let item = getKeyWithHighestValue(column.score)

      let thisscore = (column.score[item]+1)/(column.count+2)
        arr.push({"prediction":item,"confidence":thisscore})
      if(thisscore > score){
        score=thisscore
        aitem=item
        j=i
      }
      }

      return({"prediction":aitem,"confidence":score,"criteria":j})

  }

  static predictChain(str,confidence=0.05){
    let d = 1
    let outarr = []
    let i = 0 //breaker
    while(d > confidence && i < 100){
      i++
      let tpred = this.predict(str)
      let tans = this.choose(tpred)
      str += tans.prediction
      d *= tans.confidence
      outarr.push(tans)
    }
    return(outarr)
  }

  static ad(dict,entry){
    if(dict[entry]===undefined){
      dict[entry] = 0
    }
    dict[entry] += 1
  }

  static addEntry(entry,ans){
    let unknown = false

    let dict = this.contextDict[this.learningContext]

    if(dict[entry]===undefined){
      dict[entry] = {"count":0,"score":{}}
      unknown = true
    }
    dict[entry].count+=1
    // this.dict[entry].score[ans]
    this.ad(dict[entry].score,ans)
    return(unknown)
  }


  static paragraphy(p){
    for(let i = 1; i < p.length; i++){
      this.learn(p[i-1],p[i])
    }
  }

}

