let colordict = {}
for(let i = 0; i < 500; i++){
  colordict[i] = "#"+(Math.floor((Math.random()*0xFFFFFF)).toString(16))
}

function update(str){
  can.clear()
  PRE = LNgram.predict(str)
  PRANS = LNgram.choose(PRE)

  let PRE2 = LNgram.predict(str+PRANS.prediction)
  let PRANS2 = LNgram.choose(PRE2)

  PRE.forEach((e,i)=>{

  let Z = 0
      can.ctx.font = "bold 17px serif";
    Object.keys(e.score).forEach((E,I)=>{
      can.ctx.fillStyle = colordict[E.charCodeAt(0)]
      let h = e.score[E]*Height/2/e.count
      can.ctx.fillRect(70+50*i,Height/2+Z,Math.min(40,e.score[E]),h)
      can.ctx.fillStyle = "#FFF"
      can.ctx.fillText(E,70+40+50*i,Height/2+Z+h)
      Z += h
    })

  })

  PRE2.forEach((e,i)=>{

  let Z = 0
      can.ctx.font = "bold 17px serif";
    Object.keys(e.score).forEach((E,I)=>{
      can.ctx.fillStyle = colordict[E.charCodeAt(0)]
      let h = e.score[E]*Height/2/e.count
      can.ctx.fillRect(Width/2+50*i,Height/2+Z,Math.min(40,e.score[E]),h)
      can.ctx.fillStyle = "#FFF"
      can.ctx.fillText(E,Width/2+40+50*i,Height/2+Z+h)
      Z += h
    })

  })
  // can.ctx.fillStyle = "#0F0"
  // can.ctx.fillRect(200,Height/2-100,200,70)


  let PCHAIN = ""
  LNgram.predictChain(str,0.01).forEach((e)=>{
    PCHAIN += e.prediction
  })


  can.ctx.fillStyle = "#A0F"
  can.ctx.font = "bold 48px serif";
  can.ctx.fillText(PCHAIN+"-"+PRANS.prediction+PRANS2.prediction+"-"+(PRANS.confidence*100).toFixed(0)+"-"+(PRANS.confidence*PRANS2.confidence*100).toFixed(0)+"-"+PRANS.criteria+"-"+PRANS2.criteria,290,Height/2-50)
}



